import React, {useEffect} from 'react';
import './App.css';
import EventsList from './events/EvensList';

function App() {

  const [events, setEvents] = []

  useEffect(() => {
    fetch('https://s3.eu-central-1.amazonaws.com/js.smartair.co.il/custom/activities.json')
        .then(resp => resp.json())
        .then(eventItem => setEvents(eventItem))
  });

  return (
    <div className="App">
      <EventsList/>
    </div>
  );
}

export default App;
